import React from 'react'
import { Droppable, DragDropContext, Draggable } from 'react-beautiful-dnd'
function Test() {

    const data1 = [
        { id: 1, data: 1 },
        { id: 2, data: 2 },
        { id: 3, data: 3 }
    ]
    const data2 = [4, 5, 6]


    return (
        <div>
            <DragDropContext onDropEnd={result => console.log(result)} >
                <Droppable droppableId="characters">
                // {(provided) => (
                        <ul  {...provided.droppableProps} ref={provided.innerRef} >
                            {data1.map((item, i) => {
                                return (
                                    <Draggable key={item.id} draggableId={item.id} index={i}>
                                        {(provided) => (
                                            <li {...provided.draggableProps} {...provided.dragHandleProps} ref={provided.innerRef} ><div style={{ height: '50px', width: '50px' }} >{item.data}</div></li>
                                        )}
                                    </Draggable>)
                            }
                            )}
                            {provided.placeholder}
                        </ul>
                    )}
                </Droppable>
            </DragDropContext>
        </div>
    )
}

export default Test

